import React from "react";
import './search.css'
function SearchComp() {
    return (
      <div className="SearchComp">
        <span className="search-text">Search</span>
        <input type="text" className="input-text"/>
        <button className="btn-send">Send</button>
      </div>
    );
  } 

export default SearchComp;
